import withLayout from '../components/Layout';
import { useRouter } from 'next/router';

const Page = () => {
    const router = useRouter();

    return (
        <div>
            <h1>{router.query.name}</h1>
            <p>The {router.query.name} page</p>
        </div>
    );
}


export default withLayout(Page);
